import React from 'react'
//import "./active.css"

const Active = props => (
    <div className="card">
        <div className="proj">
            <strong>Project name:</strong> {props.name}
        </div>

        <div className="cur">
            <strong> Curator:</strong> {props.curs}
        </div>

        <div className="timeotr">
                Отработанные часы: {props.time}
        </div>
            <br/>
    </div>
)


export default Active
